                    model.StoreSeoUrl = entity.Store?.SeoUrl;
                    model.UserID = entity.UserID;
                    model.UserKey = entity.User?.CustomKey;
                    model.UserUserName = entity.User?.UserName;
                    model.UserContactEmail = entity is AnonSampleRequest ? ((AnonSampleRequest)entity).UserContact?.Email1 : entity.User?.Contact?.Email1;
                    model.UserContactFirstName = entity is AnonSampleRequest ? ((AnonSampleRequest)entity).UserContact?.FirstName : entity.User?.Contact?.FirstName;
                    model.UserContactLastName = entity is AnonSampleRequest ? ((AnonSampleRequest)entity).UserContact?.LastName : entity.User?.Contact?.LastName;
                    // SampleRequest's Associated Objects (Not Mapped unless Forced)
                    model.RateQuotes = (entity is AnonSampleRequest ? ((AnonSampleRequest)entity).RateQuotes : entity.RateQuotes)?.Where(x => x.Active).Select(x => ModelMapperForRateQuote.CreateRateQuoteModelFromEntityList(x, contextProfileName)).ToList()!;
                    // Additional Mappings
                    if (CreateSampleRequestModelFromEntityHooksList != null) { model = CreateSampleRequestModelFromEntityHooksList(entity, model, contextProfileName); }
                    break;
                }
            } ///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
            // Finished!
            return model;
        }
    }
}
